import React from "react";
import ExpandableContent from "./ExpandableContent";

function ExContent() {
  return (
    <div>
      <ExpandableContent title="Expandable content">
        <p>This is the expanded content</p>
      </ExpandableContent>
    </div>
  );
}

export default ExContent;
